import React, { useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [preview, setPreview] = useState(null);
  const [results, setResults] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleFileSelect = (event) => {
    const file = event.target.files[0];
    setSelectedFile(file);

    if (file) {
      const reader = new FileReader();
      reader.onloadend = () => {
        setPreview(reader.result);
      };
      reader.readAsDataURL(file);
    }
  };

  const handleUpload = async () => {
    if (!selectedFile) {
      setError('Please select an image first');
      return;
    }

    setLoading(true);
    setError(null);

    const formData = new FormData();
    formData.append('image', selectedFile);

    try {
      const response = await axios.post('http://localhost:5000/upload', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
      });

      setResults(response.data);
    } catch (err) {
      console.error('Error:', err);
      setError('Failed to analyze image. Please try again. Error: ' + err.message);
    } finally {
      setLoading(false);
    }
  };

  const ResultSection = ({ title, items, renderItem }) => {
    if (!items || items.length === 0) return null;
    return (
      <div className="mb-6">
        <h3 className="text-xl font-semibold mb-3">{title}</h3>
        <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-2">
          {items.map((item, index) => renderItem(item, index))}
        </div>
      </div>
    );
  };

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-3xl font-bold mb-6">Image Analysis with Google Cloud Vision</h1>

      <div className="mb-6">
        <input
          type="file"
          onChange={handleFileSelect}
          accept="image/*"
          className="mb-4"
        />

        {preview && (
          <div className="mb-4">
            <img src={preview} alt="Preview" className="max-w-md rounded-lg shadow-lg" />
          </div>
        )}

        <button
          onClick={handleUpload}
          disabled={!selectedFile || loading}
          className={`px-4 py-2 rounded-lg ${
            !selectedFile || loading
              ? 'bg-gray-300 cursor-not-allowed'
              : 'bg-blue-500 hover:bg-blue-600 text-white'
          }`}
        >
          {loading ? 'Analyzing...' : 'Analyze Image'}
        </button>
      </div>

      {error && (
        <div className="text-red-500 mb-4">{error}</div>
      )}

      {results && (
        <div className="space-y-6">
          <ResultSection
            title="Labels"
            items={results.labels}
            renderItem={(item, index) => (
              <div key={index} className="bg-blue-50 p-3 rounded-lg">
                <div className="font-medium">{item.description}</div>
                <div className="text-sm text-gray-600">{item.confidence}% confidence</div>
              </div>
            )}
          />

          <ResultSection
            title="Objects"
            items={results.objects}
            renderItem={(item, index) => (
              <div key={index} className="bg-green-50 p-3 rounded-lg">
                <div className="font-medium">{item.name}</div>
                <div className="text-sm text-gray-600">{item.confidence}% confidence</div>
              </div>
            )}
          />

          {results.faces.length > 0 && (
            <div className="mb-6">
              <h3 className="text-xl font-semibold mb-3">Faces</h3>
              <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-2">
                {results.faces.map((face, index) => (
                  <div key={index} className="bg-purple-50 p-3 rounded-lg">
                    <div className="text-sm">
                      <div>Joy: {face.joy}</div>
                      <div>Sorrow: {face.sorrow}</div>
                      <div>Anger: {face.anger}</div>
                      <div>Surprise: {face.surprise}</div>
                      <div className="mt-1 font-medium">{face.confidence}% confidence</div>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          )}

          <ResultSection
            title="Landmarks"
            items={results.landmarks}
            renderItem={(item, index) => (
              <div key={index} className="bg-yellow-50 p-3 rounded-lg">
                <div className="font-medium">{item.name}</div>
                <div className="text-sm text-gray-600">{item.confidence}% confidence</div>
              </div>
            )}
          />

          <ResultSection
            title="Logos"
            items={results.logos}
            renderItem={(item, index) => (
              <div key={index} className="bg-red-50 p-3 rounded-lg">
                <div className="font-medium">{item.name}</div>
                <div className="text-sm text-gray-600">{item.confidence}% confidence</div>
              </div>
            )}
          />

          {results.text && (
            <div className="mb-6">
              <h3 className="text-xl font-semibold mb-3">Text Found</h3>
              <div className="bg-gray-50 p-4 rounded-lg">
                <pre className="whitespace-pre-wrap">{results.text}</pre>
              </div>
            </div>
          )}

          <ResultSection
            title="Web Entities"
            items={results.webEntities}
            renderItem={(item, index) => (
              <div key={index} className="bg-indigo-50 p-3 rounded-lg">
                <div className="font-medium">{item.description}</div>
                <div className="text-sm text-gray-600">{item.confidence}% confidence</div>
              </div>
            )}
          />

          {results.bestGuessLabels?.length > 0 && (
            <div className="mb-6">
              <h3 className="text-xl font-semibold mb-3">Best Guess</h3>
              <div className="bg-gray-50 p-4 rounded-lg">
                {results.bestGuessLabels.map((label, index) => (
                  <div key={index} className="font-medium">{label.label}</div>
                ))}
              </div>
            </div>
          )}
        </div>
      )}
    </div>
  );
}

export default App;
